import './App.css';

class App extends Component{
  constructor(){
    super()
    this.state = {
      news: [],




    }
  }

  Mount() {
    fetch(`https://api.themoviedb.org/3/search/movie?api_key=4d3e7d92a8cb70b6f644283e8cbb2d67&query=${this.state.searchTerm}`)
    .then(data => data.json())
    .then(data=>{
      console.log(data);
      this.setState ({ news: [...data.results] })
    })
  }

  render() {
    return (
      <div className="App">



      </div>
    );
  }
} 





export default App;
